import React, { Component } from "react";
import { subscribeToClosetFeed } from "../../utils/ClosetFeed";
import { Link } from "react-router-dom";
import "./style.css";
import API from "../../utils/API";
import { runInThisContext } from "vm";
class ClosetFeed extends Component {
  constructor(props) {
    super(props);
    console.log(props);
    subscribeToClosetFeed((err, res) =>
      API.getOutfit(res._id)
        .then(outfit => {
          this.setState({
            outfit: outfit.data
          });
        })
        .catch(err => console.log(err))
    );
  }

  state = {
    outfit: false
  };

  render() {
    return (
      <p className="feed">
        <Link to={`/Closet/${this.state.outfit.user._id}/`}>
          <ClothingItem imageURL={top.imageURL} />
          {this.state.outfit ? this.state.outfit.user.username : ""} saved a new
          outfit!
        </Link>
      </p>
    );
  }
}

export default ClosetFeed;
